  const [myData, setMyData] = useState([]);

  const parsedDataHandler = (parsedData) => {
    setMyData(parsedData);
    console.log('data is seted')
  }


  return (
    <div>
      <MyButton parsedData={parsedDataHandler} />
      <Items data={myData} update={parsedDataHandler}/>
    </div>
  );
};

export default App;
